  description:
    '<span style="color:#000000;"><span style="font-size:20px;"><strong>Description:</strong></span><span style="font-size:16px;"><strong><br>\n<br>\nDual Ultra-High-Quality DACs,highly Advanced Dual-DAC Design and Tuning</strong><br>\nThe PLENUE R2 is equipped with two top-of-the-line CS43131 DACs and features an advanced dual-DAC design and tuning to bring you one step closer to analog sound. The digital input signal is converted by each discrete DAC, providing listeners with perfect sound as close to the original recording with zero noise.<br>\n<br>\n<strong>32bit,384kHz Ultra-High Resolution</strong><br>\nThe PLENUE R2 features a high-end DAC that supports 32bit, 384kHz for smooth playback of most existing high-quality audio files. As the premier DAC in the MasterHIFI line of Cirrus Logic hi-fi audio products, the CS43131 DAC offers an unparalleled level of performance. CS43131 is a high-performance DAC with a built-in high-resolution headphone amplifier. The next-generation premium DAC merely sips battery power while delivering the best audio output.<br>\n<br>\n<strong>Support Native DSD up to DSD256</strong><br>\nDSD(Direct Stream Digital) is a high quality Super Audio CD format that processes signals at 2.8224MHz per bit. The technology carries the maximum sound information possible to reproduce the delicate and crisp sound of analog. To realize the best possible sound quality, the PLENUE R2 reproduces DSD in Native method supports DSD256(Quad rate DSD), the highest frequency among all DSD formats.<br>\n<br>\n<strong>High Quality Balanced Out,Maximum Output of 4.0Vrms</strong><br>\nBalanced output effectively blocks noise generated when signals are transmitted by adding \'out of phase\' signals to unbalanced output signals.Since it transmits two types of signals simultaneously, the PLENUE R2 strengthens the output signal for clearer and crisper reproduction of original sound. The PLENUE R2 uses 2.5mm balanced output to reproduce crisp original sounds.<br>\n<br>\n<strong>High Quality Bluetooth Audio Codec,Qualcomm aptX audio</strong><br>\nThe PLENUE R2 supports aptX, a high-quality audio codec that provides higher compression efficiency and superior sound quality compared to conventional SBC codec Bluetooth transmission. You can now enjoy PLENUE R2 through any earphones, headphones, or speakers that support Bluetooth,and the application of JetEffect 7\'s powerful acoustic field via Bluetooth output means you can savor rich sound quality with greater variety.</span></span><br>\n<br>\n<br>\n<span style="color:#000000;"><span style="font-size:16px;"></span></span><span style="color:#000000;"><span style="font-size:20px;"><strong>Package Components &amp; Accessories :</strong></span></span><span style="color:#000000;"><span style="font-size:16px;"><br>\nPackage Component<br>\nPLENUE R2, USB Type-C Cable, Quick Guide, Warranty, Leather Case (sold separately)</span></span><br>\n \n<p style="text-align: left;margin:0;"><img referrerpolicy="no-referrer" src="undefined"></p>\n<span style="color:#000000;"><span style="font-size:16px;"></span></span><br>\n<br>\n ',
